import '../js/kalender'
const date = new Date();

export default function KalenderContent({content}) {
    //const date = new Date();
    return(
        <>
        <table id = "month">
            <tr>
                <td class="prev" onClick={()=>prevMonth()}>
                    &#10094
                </td>

                <td id = "cur_month">
                    A
                </td>

                <td class="next" onClick={()=>nextMonth()}>
                    &#10095
                </td>
            </tr>
            <tr>
                <td></td>
                <td id = "cur_year">
                    <p>2022</p>
                </td>
                <td></td>
            </tr>
        </table>
        <table id = "calendar_table">
            <thead>
                <tr>
                    <th>Mo</th>
                    <th>Di</th>
                    <th>Mi</th>
                    <th>Do</th>
                    <th>Fr</th>
                    <th>Sa</th>
                    <th>So</th>
                </tr>
            </thead>
            <tbody id = "days">

            </tbody>

        </table>
        </>
    );
}

function prevMonth() {
    date.setMonth(date.getMonth()-1);
    renderCalendar();
}

function nextMonth() {
    date.setMonth(date.getMonth()+1);
    renderCalendar();
}
